definition:
Having native or unaffected simplicity; ingenuous; artless;
   frank; as, naive manners; a naive person; naive and unsophisticated
   remarks.

Reputed character; reputation, good or bad; estimation; fame;
   especially, illustrious character or fame; honorable estimation;
   distinction.

Pertaining to, derived from, or related to, naphthalene;
   -- used specifically to designate any one of a series of carboxyl
   derivatives, called naphthoic acids.

With a little margin or space; by a small distance;
   hence, closely; hardly; barely; only just; -- often with reference to
   an avoided danger or misfortune; as, he narrowly escaped.

Of or pertaining to one's birth; natal; belonging to the
   place or the circumstances in which one is born; -- opposed to foreign;
   as, native land, language, color, etc.

Conferred by birth; derived from origin; born with one;
   inherent; inborn; not acquired; as, native genius, cheerfulness,
   simplicity, rights, etc.

Of or pertaining to the lower or animal nature, as
   contrasted with the higher or moral powers, or that which is spiritual;
   being in a state of nature; unregenerate.

Causing, or fitted to cause, nausea; sickening;
   loathsome; disgusting; exciting abhorrence; as, a nauseous drug or
   medicine.

Originally, a laborer on canals for internal navigation;
   hence, a laborer on other public works, as in building railroads,
   embankments, etc.

Free from what is unbecoming, inappropriate, or tawdry;
   simple and becoming; pleasing with simplicity; tasteful; chaste; as, a
   neat style; a neat dress.

Impossible to be otherwise, or to be dispensed with,
   without preventing the attainment of a desired result; indispensable;
   requiste; essential.

That which makes an act or an event unavoidable;
   irresistible force; overruling power; compulsion, physical or moral;
   fate; fatality.

A proposition by which something is denied or forbidden;
   a conception or term formed by prefixing the negative particle to one
   which is positive; an opposite or contradictory term or conception.

Steadiness and firmness of mind; self-command in personal
   danger, or under suffering; unshaken courage and endurance; coolness;
   pluck; resolution.

Having the nerves weak, diseased, or easily excited;
   subject to, or suffering from, undue excitement of the nerves; easily
   agitated or annoyed.

To move about in one's place, like a bird when shaping
   the interior of her nest or a young bird getting close to the parent;
   as, a child nestles.

Situated down or below; lying beneath, or in the lower
   part; having a lower position; belonging to the region below; lower;
   under; -- opposed to upper.

Not engaged on either side; not taking part with or
   assisting either of two or more contending parties; neuter;
   indifferent.

Having existed, or having been made, but a short time;
   having originated or occured lately; having recently come into
   existence, or into one's possession; not early or long in being; of
   late origin; recent; fresh; modern; -- opposed to old, as, a new coat;
   a new house; a new book; a new fashion.

Not before seen or known, although existing before;
   lately manifested; recently discovered; as, a new metal; a new planet;
   new scenes.

As if lately begun or made; having the state or quality
   of original freshness; also, changed for the better; renovated; unworn;
   untried; unspent; as, rest and travel made him a new man.

A report of recent occurences; information of something that
   has lately taken place, or of something before unknown; fresh tindings;
   recent intelligence.

Of or pertaining to the night, or to every night;
   happening or done by night, or every night; as, nightly shades; he kept
   nightly vigils.

Of exalted rank; of or pertaining to the nobility;
   distinguished from the masses by birth, station, or title; highborn;
   as, noble blood; a noble personage.

The quality or state of being noble; greatness; dignity;
   magnanimity; elevation of mind, character, or station; nobility;
   grandeur; stateliness.

Of or pertaining to nomads, or their way of life;
   wandering; moving from place to place for subsistence; as, a nomadic
   tribe.

One who does not conform to an established church;
   especially, one who does not conform to the established church of
   England; a dissenter.

A state or condition which daffles reason or confounds
   judgment; insuperable difficalty; inability to proceed or decide;
   puzzle; quandary.

The principles or practice of a nonresistant;
   passive obedience; submission to authority, power, oppression, or
   violence without opposition.

That which is not sense, or has no sense; words, or
   language, which have no meaning, or which convey no intelligible ideas;
   absurdity.

According to an established norm, rule, or principle;
   conformed to a type, standard, or regular form; performing the proper
   functions; not abnormal; regular; natural; analogical.

Lying toward the north; situated at the north, or in a
   northern direction from the point of observation or reckoning;
   proceeding toward the north, or coming from the north.

Of, pertaining to, or being in, the northwest; in a
   direction toward the northwest; coming from the northwest;
   northwesterly; as, a northwestern course.

One of the external openings of the nose, which give
   passage to the air breathed and to secretions from the nose and eyes;
   one of the anterior nares.

A thing of no account, value, or note; something
   irrelevant and impertinent; something of comparative unimportance;
   utter insignificance; a trifle.

Intelligence, by whatever means communicated; knowledge
   given or received; means of knowledge; express notification;
   announcement; warning.

Of or pertaining to nutrition; as, the nutritive
   functions; having the quality of nourishing; nutritious; nutrimental;
   alimental; as, nutritive food or berries.
